import React, { useState } from 'react';
import axios from 'axios';

const CLASS_LABELS = ["Setosa", "Versicolor", "Virginica"];

const PredictForm = () => {
  const [inputData, setInputData] = useState({
    dense_2_input: [5.1, 3.5, 1.4, 0.2],
  });
  const [response, setResponse] = useState(null);
  const [error, setError] = useState(null);

  const handleSubmit = async (event) => {
  event.preventDefault();
  try {
    const result = await axios.post('http://localhost:8000/predict/iris_model', inputData, {
      headers: {
        'Content-Type': 'application/json',
      },
    });
    const predictions = result.data.predictions[0];
    const maxPredictionIndex = predictions.indexOf(Math.max(...predictions));
    const predictedClass = CLASS_LABELS[maxPredictionIndex];
    setResponse({ predictedClass, probabilities: predictions });
  } catch (error) {
    console.log("Error details:", error); // Hata detaylarını logla
    setError(error.response ? error.response.data : 'An error occurred');
  }
};

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <button type="submit">Send Request</button>
      </form>
      {response && (
        <div>
          <p>Predicted Class: {response.predictedClass}</p>
          <p>Probabilities: {JSON.stringify(response.probabilities)}</p>
        </div>
      )}
      {error && <div>Error: {JSON.stringify(error)}</div>}
    </div>
  );
};

export default PredictForm;
